    <script>
        $(document).ready(function() {
            $("#search_icon").on("keyup", function() {
                var value = $(this).val().toLowerCase();
                $("#list_icon .fonticon-container").filter(function() {
                    $(this).toggle($(this).text().toLowerCase().indexOf(value) > -1)
                });
            });
        });
